import React, { Component } from 'react';

class Attending extends Component {
  constructor(props) {
    super(props);
    this.state = {
    };
  }

  render() {
    const existingEvents = this.props.attending.map(event => (
      <div value={event}>{event}</div>
    ));

    return (
      <select name="select" onChange={this.num}>
        {existingEvents}
      </select>
    );
  }
}

export default Attending;
